(181, 1, '2019-12-03 06:25:57', '2019-12-03 06:25:57', '<h2>Har I styr på jeres førstehjælp?</h2>		\n			<p>RedEnKollega giver mulighed for at søge læring og viden om førstehjælp, præcis når det passer ind i din travle hverdag.</p>		\n			<a href=\"#\" role=\"button\">\n						Bestil gratis prøve\n					</a>\n										<img width=\"580\" height=\"759\" src=\"http://localhost/wordpress/wp-content/uploads/2019/12/78612-782x1024.png\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2019/12/78612-782x1024.png 782w, http://localhost/wordpress/wp-content/uploads/2019/12/78612-229x300.png 229w, http://localhost/wordpress/wp-content/uploads/2019/12/78612-768x1005.png 768w, http://localhost/wordpress/wp-content/uploads/2019/12/78612.png 1000w\" sizes=\"(max-width: 580px) 100vw, 580px\" />											\n			<h5>Havad far du?</h5>		\n			<p>Online forsrehjaelps undervisning</p>		\n		<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut elit tellus, luctus nec ullamcorper mattis, pulvinar dapibus leo.</p>		\n			<p>Certificering                                    \n    </p>		\n		<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut elit tellus, luctus nec ullamcorper mattis, pulvinar dapibus leo.</p>		\n			<p>Tryghed pa arbejdspladsen</p>		\n		<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut elit tellus, luctus nec ullamcorper mattis, pulvinar dapibus leo.</p>		\n			<a href=\"#\" role=\"button\">\n						Bestil gratis prøve\n					</a>\n			<h5>Din persolinge</h5>		\n		[wpforms id=\"156\" title=\"false\" description=\"false\"]', '', '', 'inherit', 'closed', 'closed', '', '95-revision-v1', '', '', '2019-12-03 06:25:57', '2019-12-03 06:25:57', '', 95, 'http://localhost/wordpress/index.php/2019/12/03/95-revision-v1/', 0, 'revision', '', 0);
